    private Task SelectedSupplierChanged(SupplierDTO Supplier)
    {
        if (Supplier == null)
        {
            return ValueChanged.InvokeAsync(Guid.Empty);
        }

        selectedSupplier = Supplier;
        Value = Supplier.Id;

        return ValueChanged.InvokeAsync(Supplier.Id); //Degisim oldugunda bizi dinleyenlere bu Idyi gonder
    }


